      out.write("        if (which.value.length > maxChars) {\r\n");
      out.write("            alert(\"您出入的字数超多限制!\");\r\n");
      out.write("            // 超过限制的字数了就将 文本框中的内容按规定的字数 截取\r\n");
      out.write("            which.value = which.value.substring(0, maxChars);\r\n");
      out.write("            return false;\r\n");
      out.write("        } else {\r\n");
      out.write("            var curr = maxChars - which.value.length; //250 减去 当前输入的\r\n");
      out.write("            document.getElementById(\"sy\").innerHTML = curr.toString();\r\n");
      out.write("            return true;\r\n");
      out.write("        }\r\n");
      out.write("    }\r\n");
